    private $dynamicParameters = array();

    /**
     * Computes a dynamic parameter.
     *
     * @param string The name of the dynamic parameter to load
     *
     * @return mixed The value of the dynamic parameter
     *
     * @throws InvalidArgumentException When the dynamic parameter does not exist
     */
    private function getDynamicParameter($name)
    {
        switch ($name) {
            case 'kernel.root_dir':
                $value = $this->targetDirs[2];
                break;
            case 'kernel.project_dir':
                $value = $this->targetDirs[4];
                break;
            case 'kernel.logs_dir':
                $value = ($this->targetDirs[2].'/logs');
                break;
            case 'kernel.bundles_metadata':
                $value = array(
                'FrameworkBundle' => array(
                    'parent' => null,
                    'path' => ($this->targetDirs[4].'/vendor/symfony/symfony/src/Symfony/Bundle/FrameworkBundle'),
                    'namespace' => 'Symfony\\Bundle\\FrameworkBundle',
                ),
                'ContainerAwareBundle' => array(
                    'parent' => null,
                    'path' => ($this->targetDirs[4].'/src'),
                    'namespace' => 'BenTools\\ContainerAwareBundle',
                ),
                'TestBundle' => array(
                    'parent' => null,
                    'path' => ($this->targetDirs[2].'/TestBundle'),
                    'namespace' => 'BenTools\\ContainerAwareBundle\\Tests\\Fixtures\\TestBundle',
                ),
                );
                break;
            default:
                throw new InvalidArgumentException(sprintf('The dynamic parameter "%s" must be defined.', $name));
        }
        $this->loadedDynamicParameters[$name] = true;

        return $this->dynamicParameters[$name] = $value;
    }

